import React from "react";
import ResearchProjects from "../components/ResearchProjects";

const ResearchPage = () => {
  const project = {
    yearRange: "2023 - 2025",
    title: "Elektrik Piyasaları için Yapay Zekâ Destekli Öğrenme, Tahmin ve Optimizasyon Algoritmaları ile Etmen Temelli Benzetim Modeli Kurulması ve Piyasa İncelemeleri",
    fundingSource: "TÜBİTAK Projesi",
    summaryText: "Proje Özeti",
    summaryLink: "https://example.com/proje-ozeti", // Gerçek linki buraya koyabilirsiniz
    team: [
      { name: "Selçuklu S. B. (Yürütücü)", profileLink: "#" },
      { name: "Öztürk C.", profileLink: "#" },
      { name: "Muğaloğlu E.", profileLink: "#" },
      { name: "Arslan S.", profileLink: "#" },
      { name: "Bilgili F.", profileLink: "#" },
    ],
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-5" style={{ fontWeight: "bold" }}>
        Research Projects
      </h2>
      <ResearchProjects project={project} />
    </div>
  );
};

export default ResearchPage;
